pragma solidity >=0.7.0 <0.9.0;
import "./BusinessConsensus.sol";
contract MotherContract{
    mapping(bytes32 => address) public userContractAddress;
    function createContractInstance(address contractAddress) external {
      BusinessConsensus smartContract = BusinessConsensus(contractAddress);
      bytes32 proposalID = keccak256(bytes(smartContract.getValues()));
      userContractAddress[proposalID] = contractAddress;
    }
    function getContractAddress(string memory _messageID) external view returns (address){
        return userContractAddress[keccak256(bytes(_messageID))];
    }
}

contracts/BusinessConsensus.sol.content:
pragma solidity >=0.7.0 <0.9.0;
contract BusinessConsensus{
    // This declares a new complex type which will
    // be used for variables later.
    // It will represent a single voter.
    struct Voter {
        bool voted;  // if true, that person already voted
        bool vote;   //represents approval or disapproval
        address recipient; // represents a stakeholder recipient
    }
    // This is a type for a single proposal.
    struct Proposal {
        uint voteCount; // number of accumulated votes
        string messageID; // message ID of proposal
    }

    address public contractAddress;

    // address initiator in this specific business scenario
    address public initiator;

    address[] public keys;

    //expiry date
    uint256 expiryDate;

    uint256 public BusinessRequirement;
    uint256 public AccumulatedPercentage;
    uint256 public numApprovals;

    uint256 public numberCompiled;

    //final verdict
    bytes32 finalVerdict;

    Voter[] public voters;

    mapping(address => Voter) public voters_map;

    // A struct for relevant info of the business proposal at hand
    Proposal public proposal;

    constructor(string memory _messageID, uint expiry, uint requiredPercentage){
        initiator = msg.sender;
        expiryDate = block.timestamp + expiry;
        BusinessRequirement = requiredPercentage;
        AccumulatedPercentage = 0;
        numApprovals = 0;
        numberCompiled = 0;
        finalVerdict = "Rejected";
        contractAddress = address(this);
        // initialize proposal set by the original sender and counted votes to zero
        proposal = Proposal({
                voteCount: 0,
                messageID: _messageID
            });
    }
    function getValues() public view returns (string memory){
        return proposal.messageID;
    }
    function getParameters() external view returns (string memory, uint , address ,uint ,uint){
        return (proposal.messageID,expiryDate,initiator,BusinessRequirement,numApprovals);
    }
    function getParameters2(address test_address) external view returns (bool, bool, address){
        return (voters_map[test_address].vote, voters_map[test_address].voted, voters_map[test_address].recipient);
    }
    // Give `voter` the right to vote in this proposal.
    // May only be called by `initiator`.
    function RegisterVoter(address voter) external {
        // only initiator can register a recipient in the voting process
        require(
            msg.sender == initiator,
            "Only initiator can register a recipient."
        );
        require(voter != initiator, "Initiator can't vote!");

        require(voters_map[voter].recipient == address(0), "Recipient is already registered");

        require(block.timestamp < expiryDate, "Proposal has reached its expiry date");

        Voter memory x = Voter({voted: false,recipient: voter, vote: false});
        voters_map[voter] = x;
        keys.push(voter);
    }

    function Vote(string memory response) external {

        require(block.timestamp < expiryDate, "Voting has expired");
        require(voters_map[msg.sender].recipient != address(0x0), "You are not registered to vote");
        require(!voters_map[msg.sender].voted, "You already sent a response.");

        if(keccak256(bytes(response)) == keccak256(bytes("i approve"))){
            voters_map[msg.sender].voted = true;
            voters_map[msg.sender].vote = true;
            numApprovals += 1;
            proposal.voteCount += 1;
            voters.push(voters_map[msg.sender]);
        }

        else if(keccak256(bytes(response)) == keccak256(bytes("i disapprove"))){
            voters_map[msg.sender].voted = true;
            proposal.voteCount += 1;
            voters.push(voters_map[msg.sender]);
        }
        //if given invalid response, it will be considered a disapproval
        else{
            voters_map[msg.sender].voted = true;
            proposal.voteCount += 1;
            voters.push(voters_map[msg.sender]);
        }
        
    }

    /// compile all relevant information into a Bundle
    function Consensus() external {
        require(block.timestamp >= expiryDate, "Verdict has not been reached yet");
        require(numberCompiled == 0, "Consensus has already been calculated");
        require(msg.sender == initiator || voters_map[msg.sender].recipient != address(0x0), "You aren't authorize to compile Bundle");
        AccumulatedPercentage = (numApprovals/keys.length)*100;
        if(AccumulatedPercentage >= BusinessRequirement){
            finalVerdict = "Accepted";
        }
        for(uint8 i=0; i< keys.length; i++){
            if(voters_map[keys[i]].voted == false){
                voters.push(voters_map[keys[i]]);
            }
        }
        numberCompiled += 1;
    }

    function retrieve_bundle() external view returns (bytes32, Proposal memory, Voter[] memory){
        require(block.timestamp >= expiryDate, "Verdict has not been reached yet");
        return (finalVerdict,proposal,voters);
        
    }

}

